 used instead, but is technologically different.\"},{\"lang\":\"fr\",\"value\":\"File Transfer Protocol (protocole de transfert de fichiers), ou FTP, est un protocole de communication destin  l\\\\\'change informatique de fichiers sur un rseau TCP/IP. Il permet, depuis un ordinateur, de copier des fichiers vers un autre ordinateur du rseau, ou encore de supprimer ou de modifier des fichiers sur cet ordinateur. Ce mcanisme de copie est souvent utilis pour alimenter un site web hberg chez un tiers.\"}]},\"commands\":[{\"name\":\"App-Protocol-FTP-Commands\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::ftp::plugin --mode commands --hostname=$HOSTADDRESS$ $_HOSTFTPEXTRAOPTIONS$ --username=\\\\\'$_HOSTFTPUSERNAME$\\\\\' --password=\\\\\'$_HOSTFTPPASSWORD$\\\\\' --warning=\\\\\'$_SERVICEWARNING$\\\\\' --critical=\\\\\'$_SERVICECRITICAL$\\\\\' --ftp-command=\\\\\'$_SERVICEFTPCOMMAND$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"},{\"name\":\"App-Protocol-FTP-Date\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::ftp::plugin --mode=date --hostname=$HOSTADDRESS$ $_HOSTFTPEXTRAOPTIONS$ --username=\\\\\'$_HOSTFTPUSERNAME$\\\\\' --password=\\\\\'$_HOSTFTPPASSWORD$\\\\\' --warning=\\\\\'$_SERVICEWARNING$\\\\\' --critical=\\\\\'$_SERVICECRITICAL$\\\\\' --directory=\\\\\'$_SERVICEDIRECTORY$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"},{\"name\":\"App-Protocol-FTP-FilesCount\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::ftp::plugin --mode=filescount --hostname=$HOSTADDRESS$ $_HOSTFTPEXTRAOPTIONS$ --username=\\\\\'$_HOSTFTPUSERNAME$\\\\\' --password=\\\\\'$_HOSTFTPPASSWORD$\\\\\' --warning=\\\\\'$_SERVICEWARNING$\\\\\' --critical=\\\\\'$_SERVICECRITICAL$\\\\\' --directory=\\\\\'$_SERVICEDIRECTORY$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"},{\"name\":\"App-Protocol-FTP-Login\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::ftp::plugin --mode=login --hostname=$HO