 by e-mail clients to retrieve e-mail messages from a mail server over a TCP/IP connection. IMAP is defined by RFC 3501.\\r\\nIMAP was designed with the goal of permitting complete management of an email box by multiple email clients, therefore clients generally leave messages on the server until the user explicitly deletes them. An IMAP server typically listens on port number 143. IMAP over SSL (IMAPS) is assigned the port number 993.\\r\\n\\r\\nVirtually all modern e-mail clients and servers support IMAP. IMAP and the earlier POP3 (Post Office Protocol) are the two most prevalent standard protocols for email retrieval, with many webmail service providers such as Gmail, Outlook.com and Yahoo! Mail also providing support for either IMAP or POP3.\"},{\"lang\":\"fr\",\"value\":\"Au sens strict, Interactive Message Access Protocol devenu avec IMAP 4 Internet Message Access Protocol (IMAP) est un protocole qui permet d\\\\\'accder  ses courriers lectroniques directement sur les serveurs de messagerie. Son fonctionnement est donc  l\\\\\'oppos de POP qui, lui rcupre les messages localement (depuis le poste de travail) via un logiciel spcialis3. L\\\\\'volution des diffrentes versions d\\\\\'IMAP (IMAP 4) en fait aujourd\\\\\'hui un protocole permettant galement de rcuprer les messages localement.\"}]},\"commands\":[{\"name\":\"App-Protocol-IMAP-Login\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::imap::plugin --mode=login --hostname=$HOSTADDRESS$ --username=\\\\\'$_HOSTIMAPUSERNAME$\\\\\' --password=\\\\\'$_HOSTIMAPPASSWORD$\\\\\' $_HOSTIMAPEXTRAOPTIONS$ --warning=\\\\\'$_SERVICEWARNING$\\\\\'  --critical=\\\\\'$_SERVICECRITICAL$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"},{\"name\":\"App-Protocol-IMAP-Search-Message\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::imap::plugin --mode=search-message --hostname=$HOSTADDRESS$ --username=\\\\\'$_HOSTIMAPUSERNAME$\\\\\' --password=\\\\\'$_HOSTIMAPPASSWORD$\\\\