",\"changelog\":\"N/A\",\"description\":[{\"lang\":\"en\",\"value\":\"The Lightweight Directory Access Protocol (LDAP; /??ldp/) is an open, vendor-neutral, industry standard application protocol for accessing and maintaining distributed directory information services over an Internet Protocol (IP) network.[1] Directory services play an important role in developing intranet and Internet applications by allowing the sharing of information about users, systems, networks, services, and applications throughout the network.[2] As examples, directory services may provide any organized set of records, often with a hierarchical structure, such as a corporate email directory. Similarly, a telephone directory is a list of subscribers with an address and a phone number.\"},{\"lang\":\"fr\",\"value\":\"Lightweight Directory Access Protocol (LDAP) est  l\\\\\'origine un protocole permettant l\\\\\'interrogation et la modification des services d\\\\\'annuaire. Ce protocole repose sur TCP/IP. Il a cependant volu pour reprsenter une norme pour les systmes d\\\\\'annuaires, incluant un modle de donnes, un modle de nommage, un modle fonctionnel bas sur le protocole LDAP, un modle de scurit et un modle de rplication. C\\\\\'est une structure arborescente dont chacun des nuds est constitu d\\\\\'attributs associs  leurs valeurs. LDAP est moins complexe que le modle X.500 dict par l\\\\\'UIT-T.\"}]},\"commands\":[{\"name\":\"App-Protocol-LDAP-Login\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::ldap::plugin --mode=login --hostname=$HOSTADDRESS$ --username=\\\\\'$_HOSTLDAPUSERNAME$\\\\\' --password=\\\\\'$_HOSTLDAPPASSWORD$\\\\\' $_HOSTLDAPEXTRAOPTIONS$ --warning=\\\\\'$_SERVICEWARNING$\\\\\'  --critical=\\\\\'$_SERVICECRITICAL$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"},{\"name\":\"App-Protocol-LDAP-Search\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::ldap::plugin --mode=search --hostname=$HOSTADDRESS$ --username=\\\\\