scription\":[{\"lang\":\"en\",\"value\":\"Network Time Protocol (NTP) is a networking protocol for clock synchronization between computer systems over packet-switched, variable-latency data networks. In operation since before 1985, NTP is one of the oldest Internet protocols in current use. NTP was originally designed by David L. Mills of the University of Delaware, who still oversees its development.\"},{\"lang\":\"fr\",\"value\":\"Le Protocole d\\\\\'Heure Rseau (Network Time Protocol ou NTP) est un protocole qui permet de synchroniser, via un rseau informatique, l\\\\\'horloge locale d\\\\\'ordinateurs sur une rfrence d\\\\\'heure.\\r\\n\\r\\nLa premire version v0 de NTP, formalise dans la RFC 958, date de septembre 1985. Ds le dbut, ce protocole fut conu pour offrir une prcision de synchronisation meilleure que la seconde. Par rapport au service  Time Protocol  qui offre un service d\\\\\'heure sans proposer une infrastructure, le projet NTP propose une solution globale et universelle de synchronisation qui est utilisable dans le monde entier.\"}]},\"commands\":[{\"name\":\"App-Protocol-NTP-Response-Time\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::ntp::plugin --mode=response-time --hostname=$HOSTADDRESS$ --warning=\\\\\'$_SERVICEWARNING$\\\\\' --critical=\\\\\'$_SERVICECRITICAL$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"}],\"service_templates\":[{\"name\":\"APP-Appservers-JMX-system_fd-custom\",\"alias\":\"jmx-fd\",\"parent_template\":\"APP-Appservers-JMX-system_fd\",\"_comment\":\"{FR: Contrle le nombre de descripteur de fichier ouvert par une application. Les tats suivants peuvent tre remonts : * **OK**: pourcentage de descripteur de fichier ouvert infrieur au seuil d\'alerte\",\"macros\":[],\"discovery_list_mode\":\"\",\"icon\":\"\"},{\"name\":\"APP-Appservers-JMX-system_fd\",\"alias\":\"jmx-fd\",\"parent_template\":\"generic-active-service\",\"_comment\":\"{FR: Contrle le nombre de descripteur de fichier ouvert par une appl