tocole simple de transfert de courrier ) est un protocole de communication utilis pour transfrer le courrier lectronique (courriel) vers les serveurs de messagerie lectronique.\\r\\nSMTP est un protocole assez simple (comme son nom l\\\\\'indique). On commence par spcifier l\\\\\'expditeur du message, puis le ou les destinataires d\\\\\'un message, puis, en gnral aprs avoir vrifi leur existence, le corps du message est transfr. Il est possible de tester un serveur SMTP en utilisant la commande telnet sur le port 25 d\\\\\'un serveur distant.\"}]},\"commands\":[{\"name\":\"App-Protocol-SMTP-Login\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::smtp::plugin --mode=login --hostname=$HOSTADDRESS$ --username=\\\\\'$_HOSTSMTPUSERNAME$\\\\\' --password=\\\\\'$_HOSTSMTPPASSWORD$\\\\\' $_HOSTSMTPEXTRAOPTIONS$ --warning=\\\\\'$_SERVICEWARNING$\\\\\'  --critical=\\\\\'$_SERVICECRITICAL$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"},{\"name\":\"App-Protocol-SMTP-Message\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::smtp::plugin --mode=message --hostname=$HOSTADDRESS$ --username=\\\\\'$_HOSTSMTPUSERNAME$\\\\\' --password=\\\\\'$_HOSTSMTPPASSWORD$\\\\\' $_HOSTSMTPEXTRAOPTIONS$ --smtp-from=\\\\\'$_SERVICESMTPFROM$\\\\\' --smtp-to=\\\\\'$_SERVICESMTPTO$\\\\\' --warning=\\\\\'$_SERVICEWARNING$\\\\\' --critical=\\\\\'$_SERVICECRITICAL$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"}],\"service_templates\":[{\"name\":\"App-Protocol-SMTP-Login-Custom\",\"alias\":\"SMTP-Login\",\"parent_template\":\"App-Protocol-SMTP-Login\",\"_comment\":\"{FR: Contrle la connexion vers un serveur SMTP.}\\n\\n{EN: Check connection to a SMTP server.}\",\"macros\":[],\"discovery_list_mode\":\"\",\"icon\":\"\"},{\"name\":\"App-Protocol-SMTP-Login\",\"alias\":\"SMTP-Login\",\"parent_template\":\"generic-active-service\",\"_comment\":\"{FR: Contrle la connexion vers un serveur SMTP.}\\n\\n{EN: Check connection to a SMTP server.}\",\"macros\":[{\"key\"